  summary: "コレクションを反復処理できる列挙子を返します。"
  remarks: "列挙子は、コレクション内のデータの読み取りのみ許可します。 列挙子を使用して、基になるコレクションを変更することはできません。       最初に、列挙子はコレクションの最初の項目の前に位置付けられます。 この位置で、呼び出す<xref:System.Windows.Media.Media3D.Vector3DCollection.Enumerator.Current%2A>例外をスローします</xref:System.Windows.Media.Media3D.Vector3DCollection.Enumerator.Current%2A>。 そのため、呼び出す必要があります<xref:System.Windows.Media.Media3D.Vector3DCollection.Enumerator.MoveNext%2A>列挙子を現在の値を読み取る前に、コレクションの最初の項目に進みます</xref:System.Windows.Media.Media3D.Vector3DCollection.Enumerator.MoveNext%2A>。       現在、MoveNext まで同じオブジェクトを返しますまたは<xref:System.Windows.Media.Media3D.Vector3DCollection.Enumerator.Reset%2A>と呼びます</xref:System.Windows.Media.Media3D.Vector3DCollection.Enumerator.Reset%2A>。 MoveNext は、次の項目に現在を設定します。       コレクションの末尾が渡されると、列挙子がコレクション内の最後の項目の後に配置されている MoveNext を呼び出す false を返します。 MoveNext の最後の呼び出しには、false が返されます、現在の呼び出し元は例外をスローします。 再度、コレクションの最初の項目に現在を設定するには、MoveNext 続けてのリセットを呼び出すことができます。       コレクションが変更されない限り、列挙子は有効です。 を追加するなど、コレクションに変更された場合は、変更または削除するアイテム、列挙子は回復不可能と MoveNext またはリセットするには、次の呼び出しが、InvalidOperationException をスローします。 MoveNext と現在のコレクションを変更する場合、現在は、列挙子が既に無効になっている場合でもに設定されている項目を返します。       列挙子はコレクションへの排他アクセスがありません。そのため、コレクションの列挙は、本質的には、スレッド セーフなプロシージャではします。 コレクションが同期されている場合でも、他のスレッドがコレクションを変更する、これにより、列挙子は例外をスローします。 列挙処理中には、スレッド セーフを確保するには、列挙中にコレクションをロックするか、他のスレッドによって行われた変更に起因する例外をキャッチします。"
